-- sequences (From Ensembl). Retrieved from DB general which has Ensembl-specific UDFs that were used.
-- Sequences retrieved using this function that was written for the purpose:
/*
CREATE OR REPLACE FUNCTION ensembl.get_germline_protein_sequences()
RETURNS VOID
AS
$$
DECLARE
  l_ensembl_gene_ids TEXT[];
  l_ensembl_gene_id TEXT;
  l_aa_sequence TEXT;
BEGIN
  SELECT
    ARRAY_AGG(ensembl_gene_id) INTO l_ensembl_gene_ids
  FROM
    (SELECT
       ensembl_gene_id
     FROM
       ensembl.germline_genes
     EXCEPT
     SELECT
       ensembl_gene_id
     FROM
