	    VALUES(MD5(l_aa_sequence), l_aa_sequence, l_ensembl_gene_id, NULL);
	EXCEPTION
	  WHEN OTHERS THEN
		  VALUES(NULL, NULL, l_ensembl_gene_id, SQLERRM);
	END;
  END LOOP;
END;
$$
LANGUAGE plpgsql;
*/


